import {
  Route,
  Routes,
  BrowserRouter,
} from "react-router-dom";
import "./style.css"
import Add from "./pages/Add";
import Books from "./pages/Books";
import Update from "./pages/Update";

function App() {
  return (
    <div className="App">
       <BrowserRouter>
       <Routes>
          <Route path="/" element={<Books />} />
          <Route path="/add" element={<Add />} />
          <Route path="/update/:id" element={<Update />} />
        </Routes>
       </BrowserRouter>
    </div>
  );
}

export default App;
